import React, { Component } from 'react';
import './ListOfJobs.css';

class ListOfJobs extends Component {
	
	constructor(props) {
		super(props);
	}
	
	createJobs(job) {
		return <li key={job.key}>{job.text}</li>
	}
	
	render() {
		
		let list = this.props.entries.map(this.createJobs);
		
		return(
			<ul className='jobList'>
				{list}
			</ul>
		);
	}
}

export default ListOfJobs;
